@EU_Commission @NATO @vonderleyen
Avete avuto 8 anni per risolvere il problema con #Ucraina e avete dato il permesso di mettere la #NATO dove non doveva essere messa.Diplomazia zero.
Non perdono anche a voi questa guerra.

@EU_Commission All #EU member states that are not yet, they should join #NATO as soon as possible.

The cowardly threats of #Moscow to the free democracies of the Union are unacceptable.

#Putin #Ukraine #Russia #UkraineInvasion #UkraineRussiaConflict

@EU_Commission There never was a time where I felt disgraced as a citizen of the EU.

Until now.

If you wish to continue not doing anything, you might as well send some diplomats to München to sign over Ukraine to the Russians.

@EU_Commission @eu_echo @JanezLenarcic Why is Germany blocking Russia's exclusion from SWIFT?
Ribbentrop-Molotov 2.0?
Shame.
